import { useState } from "react";

const Prices = (props) => {
  const [currency, setCurrency] = useState("USD");

  const renderList = () => {
    if (currency === "USD") {
      return "HI GUYS";
    }
  };

  return <div>{renderList}</div>;
};

export default Prices;
